			shellScript = "GECKO_DIST_BIN=\"${GECKO_DIST}/bin\"\n\n# App's Frameworks folder\nFRAMEWORKS_DIR=\"${BUILT_PRODUCTS_DIR}/${FRAMEWORKS_FOLDER_PATH}\"\nmkdir -p \"${FRAMEWORKS_DIR}\"\n\n# Copy dylibs to app's Frameworks/\ncp -fL \"${GECKO_DIST_BIN}/\"*.dylib \"${FRAMEWORKS_DIR}/\"\n\n# Copy child process binary to app's Frameworks/\ncp -fL \"${GECKO_DIST_BIN}/plugin-container\" \"${FRAMEWORKS_DIR}/\"\n\n# Sign all libs in Frameworks/\nfor lib in \"${FRAMEWORKS_DIR}/XUL\" \"${FRAMEWORKS_DIR}/plugin-container\" \"${FRAMEWORKS_DIR}/\"*.dylib; do\n    if [ -f \"$lib\" ]; then\n        codesign --force --sign \"Apple Development\" \"$lib\"\n    fi\ndone\n\n# Create GeckoView.framework structure for Gecko resource lookup\nGECKOVIEW_FW=\"${FRAMEWORKS_DIR}/GeckoView.framework\"\nmkdir -p \"${GECKOVIEW_FW}/Frameworks\"\n\n# Create Info.plist for the framework\ncat > \"${GECKOVIEW_FW}/Info.plist\" << 'EOF'\n<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!DOCTYPE plist PUBLIC \"-//Apple//DTD PLIST 1.0//EN\" \"http://www.apple.com/DTDs/PropertyList-1.0.dtd\">\n<plist version=\"1.0\">\n<dict>\n  <key>CFBundleDevelopmentRegion</key>\n  <string>en</string>\n  <key>CFBundleExecutable</key>\n  <string>XUL</string>\n  <key>CFBundleIdentifier</key>\n  <string>org.mozilla.GeckoView</string>\n  <key>CFBundleInfoDictionaryVersion</key>\n  <string>6.0</string>\n  <key>CFBundleName</key>\n  <string>GeckoView</string>\n  <key>CFBundlePackageType</key>\n  <string>FMWK</string>\n  <key>CFBundleShortVersionString</key>\n  <string>1.0</string>\n  <key>CFBundleVersion</key>\n  <string>1</string>\n  <key>MinimumOSVersion</key>\n  <string>15.0</string>\n</dict>\n</plist>\nEOF\n\n# Copy XUL to framework root as bundle executable\ncp -fL \"${GECKO_DIST_BIN}/XUL\" \"${GECKOVIEW_FW}/XUL\"\ncodesign --force --sign \"Apple Development\" \"${GECKOVIEW_FW}/XUL\"\n\n# Copy child process binary to GeckoView.framework/Frameworks/\ncp -fL \"${GECKO_DIST_BIN}/plugin-container\" \"${GECKOVIEW_FW}/Frameworks/\"\ncodesign --force --sign \"Apple Development\" \"${GECKOVIEW_FW}/Frameworks/plugin-container\"\n\n# Copy Gecko resources to GeckoView.framework/Frameworks/\ncp -fL \"${GECKO_DIST_BIN}/greprefs.js\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -fL \"${GECKO_DIST_BIN}/application.ini\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -fL \"${GECKO_DIST_BIN}/platform.ini\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -fL \"${GECKO_DIST_BIN}/chrome.manifest\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -fL \"${GECKO_DIST_BIN}/dependentlibs.list\" \"${GECKOVIEW_FW}/Frameworks/\"\n\n# Copy resource directories (use -L to dereference all symlinks)\ncp -RfL \"${GECKO_DIST_BIN}/chrome\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/defaults\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/res\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/components\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/modules\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/actors\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/localization\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/contentaccessible\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/hyphenation\" \"${GECKOVIEW_FW}/Frameworks/\"\ncp -RfL \"${GECKO_DIST_BIN}/dictionaries\" \"${GECKOVIEW_FW}/Frameworks/\"\n\n# Fix for \"resource://default-theme/ does not contain a valid manifest\"\n# Copy default-theme from source since it's excluded in GeckoView builds but required by XPIProvider\nDEFAULT_THEME_SRC=\"${SRCROOT}/truefox/toolkit/mozapps/extensions/default-theme\"\nif [ -d \"${DEFAULT_THEME_SRC}\" ]; then\n    mkdir -p \"${GECKOVIEW_FW}/Frameworks/default-theme\"\n    cp -RfL \"${DEFAULT_THEME_SRC}/\" \"${GECKOVIEW_FW}/Frameworks/default-theme/\"\n    # Register resource://default-theme/ in chrome.manifest\n    echo \"resource default-theme file:default-theme/\" >> \"${GECKOVIEW_FW}/Frameworks/chrome.manifest\"\n    echo \"Manually patched default-theme resource\"\nelse\n    echo \"WARNING: default-theme source not found at ${DEFAULT_THEME_SRC}\"\nfi\n\n# Sign the framework itself\ncodesign --force --sign \"Apple Development\" \"${GECKOVIEW_FW}\"\n\n# Resign embedded extensions and final app bundle\nAPP_BUNDLE=\"${BUILT_PRODUCTS_DIR}/${WRAPPER_NAME}\"\nPLUGINS_DIR=\"${APP_BUNDLE}/PlugIns\"\nif [ -d \"${PLUGINS_DIR}\" ]; then\n    for appex in \"${PLUGINS_DIR}\"/*.appex; do\n        if [ -d \"$appex\" ]; then\n            codesign --force --deep --sign \"Apple Development\" \"$appex\"\n        fi\n    done\nfi\n\ncodesign --force --deep --sign \"Apple Development\" \"${APP_BUNDLE}\"\n";
